import "./App.css";

function App() {
  return (
    <div className="App">
      <ul>
        <li>Task 1</li>
        <li>Task 2</li>
        <li>Task 3</li>
        <li>Task 4</li>
      </ul>
    </div>
  );
}

export default App;
